export const COLUMNS = [
  {
    Header: 'List of Patients',
    columns: [
      {
        Header: 'ID',
        accessor: 'id',
      },
      {
        Header: 'First Name',
        accessor: 'first_name',
      },
      {
        Header: 'Last Name',
        accessor: 'last_name',
      },
      {
        Header: 'Email',
        accessor: 'email',
      },
      {
        Header: 'Sex',
        accessor: 'sex',
      },
      {
        Header: 'Creation Date',
        accessor: 'created_at',
      },
    ],
  },
];

export const groupedColumns = [
  {
    Header: 'ID',
    accessor: 'id',
  },
  {
    Header: 'Name',
    columns: [
      {
        Header: 'First Name',
        accessor: 'first_name',
      },
      {
        Header: 'Last Name',
        accessor: 'last_name',
      },
    ],
  },
  {
    Header: 'Email',
    accessor: 'email',
  },
  {
    Header: 'Sex',
    accessor: 'sex',
  },
  {
    Header: 'Creation Date',
    accessor: 'created_at',
  },
];
